                                                                                                                                                                                  'caa10d8a-eee6-4438-afb8-f353fe087596',
                                                                                                                                                                                  '[{"data":{"id":"iqtlabscentralnode","label":"IQT Labs"}},{"data":{"id":"projectpcapviz","label":"PCAPviz","parentId":"themeuxdesign","attributes":{"Link":"https://www.iqt.org/pcapviz-making-packet-capture-data-more-accessible/","Image":"https://www.iqt.org/wp-content/uploads/2021/01/Image_1-1024x614.png","Status":"Complete","Description":"PCAPviz is a user interface for packet capture (PCAP) analytics. It helps system administrators identify devices on a network, review traffic encryption, and see port listening ranges."}}},{"data":{"id":"a7ce4a7a-8c07-4809-bf68-c3405b5626a5","source":"themeuxdesign","target":"projectpcapviz"}},{"data":{"id":"41243d3a-695d-498f-a15c-f286282d23a2","source":"themecyber","target":"projectpcapviz"}},{"data":{"id":"projectvericat","label":"VeriCAT","parentId":"themeuxdesign","attributes":{"Link":"https://iqtlabs.github.io/VeriCAT-UI/","Image":"https://www.andreabrennen.com/wp-content/uploads/2020/09/VeriCAT-WEB-preset-large-e1600108733537-1024x588.png","Status":"Complete","Description":"VeriCAT is an explainable AI (XAI) interface designed to help users understand the quality and limitations of machine translations."}}},{"data":{"id":"f8014b06-21e7-4d42-8493-1a6d1f1fdcd6","source":"themeuxdesign","target":"projectvericat"}},{"data":{"id":"87c0dd9f-eb0f-493c-93d5-be46d737f132","source":"themebettermodels","target":"projectvericat"}},{"data":{"id":"projectviziflu/coviz","label":"Viziflu/COVIZ","parentId":"themeuxdesign","attributes":{"Link":"https://medium.com/high-stakes-design/coviz-visualizing-uncertainty-in-infectious-disease-forecasts-d3ce33fd3bda","Image":"https://miro.medium.com/max/1200/1*OjW66jGjjk1tqGB-RCaU2Q.png","Status":"Complete","Description":"Viziflu/COVIZ is a visualization tool that displays multiple predictions about the timing of ''peak week,'' the week with the highest number of forecasted flu (or COVID) cases nationwide."}}},{"data":{"id":"22249f95-b6c8-4cd1-af8b-aea90104e916","source":"themeuxdesign","target":"projectviziflu/coviz"}},{"data":{"id":"dd12ef5d-58dc-4f48-adfe-fc4898511c62","source":"themebetterdata","target":"projectviziflu/coviz"}},{"data":{"id":"projectwhereintheworld","label":"Where in the World","parentId":"themebetterdata","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592180/themes/undraw_connected_world_wuay.png","Status":"Ongoing","Description":"A software tool and dataset that extend existing Cross-View Image Geo-Location (CVIG) techniques for terrestrial overhead to work with consumer-grade outdoor photos."}}},{"data":{"id":"f80e3fac-857c-43ae-808c-dc704d227d2e","source":"themebetterdata","target":"projectwhereintheworld"}},{"data":{"id":"95738c58-f7fe-4f8f-b6d6-110190574747","source":"thememisinformation","target":"projectwhereintheworld"}},{"data":{"id":"projectfusingwithoutconfusing","label":"Fusing Without Confusing","parentId":"themebettermodels","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592401/themes/undraw_building_blocks_n0nc.png","Status":"Ongoing","Description":"Assess the risks and opportunities with multimodal machine learning models and associated data sources used in person (re)identification."}}},{"data":{"id":"3b9b0dae-8456-4e55-ad8d-24d28f1a77dc","source":"themebettermodels","target":"projectfusingwithoutconfusing"}},{"data":{"id":"d51e17bd-0f39-4b5d-b84a-76fe49beb316","source":"thememisinformation","target":"projectfusingwithoutconfusing"}},{"data":{"id":"projectsynthesizingrobustness","label":"Synthesizing Robustness","parentId":"themebetterdata","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592291/themes/undraw_privacy_protection_nlwy.png","Status":"Complete","Description":"Explore how synthetic data can improve the robustness of deep learning models and related techniques such as Generative Adversarial Networks (GANs) in the context of very-high resolution overhead imagery."}}},{"data":{"id":"143b0ad7-aac2-488c-8fe7-c83055dacb64","source":"themebetterdata","target":"projectsynthesizingrobustness"}},{"data":{"id":"9ad1ce9c-37c5-4ed0-92d6-95856f199314","source":"themebettermodels","target":"projectsynthesizingrobustness"}},{"data":{"id":"projectaisonobuoy","label":"AI Sonobuoy","parentId":"themeedgeai","attributes":{"Link":"https://github.com/IQTLabs/AISonobuoy","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612759820/themes/undraw_Golden_gate_bridge_jkph.png","Status":"Ongoing","Description":"Much of the world is covered with water. Getting devices to work in this domain takes a lot of effort. Sonobuoy provides IQT Labs with hands-on experience collecting audio data and metadata for maritime situational awareness."}}},{"data":{"id":"ac58b9ed-8363-46de-9ac6-c90d31c3913a","source":"themeedgeai","target":"projectaisonobuoy"}},{"data":{"id":"projectdefensive-5g","label":"Defensive-5G","parentId":"themecyber","attributes":{"Link":"https://github.com/IQTLabs/AISonobuoy#pibuoy-1","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592351/themes/undraw_hacker_mind_6y85.png","Status":"Ongoing","Description":"Too often the default response to an attack is to retroactively block or deny access. This project examines the effetciveness of proven network defense tools and techniques in proactively securing multi-tenant 5G networks."}}},{"data":{"id":"48e8699c-229f-4ae9-a1bf-e349f543674f","source":"themecyber","target":"projectdefensive-5g"}},{"data":{"id":"596d4ec6-1f11-4d4e-8451-ecb49e719d8f","source":"themeedgeai","target":"projectdefensive-5g"}},{"data":{"id":"projectfakefinder","label":"FakeFinder","parentId":"thememisinformation","attributes":{"Link":"https://www.iqt.org/fakefinder-a-platform-for-deepfake-detection/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612760352/themes/undraw_Image__folder_re_hgp7.png","Status":"Complete","Description":"This project will develop a modular framework for accessing various deepfake detection models. When complete, it will offer a web application as well as API for integration into existing workflows for media forensics."}}},{"data":{"id":"2766de18-c526-4363-9c65-5ddd46ca2c15","source":"thememisinformation","target":"projectfakefinder"}},{"data":{"id":"6a07a1f7-6e38-4c92-b3d3-152bed7238d4","source":"themebettermodels","target":"projectfakefinder"}},{"data":{"id":"projectbirdseye","label":"BirdsEye","parentId":"themeedgeai","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592211/themes/undraw_Follow_me_drone_kn76.png","Status":"Complete","Description":"This project prototypes the capability to identify the location of a moving drone operator using an adaptive statistical technique to identify the radio frequency (RF) source signal. It  uses low-cost, distributed sensors and reinforcement learning"}}},{"data":{"id":"82bead73-d10f-4f72-8040-fd376440a5a5","source":"themeedgeai","target":"projectbirdseye"}},{"data":{"id":"bdddc004-633e-45df-a6b7-02403095fc10","source":"themecyber","target":"projectbirdseye"}},{"data":{"id":"projectshiftingpixels","label":"Shifting Pixels","parentId":"themeedgeai","attributes":{"Link":"https://www.iqt.org/exploring-and-experimenting-with-event-cameras/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599589298/themes/undraw_explore_7ofa.png","Status":"Complete","Description":"Event cameras are an emerging sensing technology that allow us to perceive the world in new ways. The Shifting Pixels project explores the usability of event cameras and their applicability to customer challenges."}}},{"data":{"id":"a1bc4a93-a2e6-475c-98c7-98f28abd784f","source":"themeedgeai","target":"projectshiftingpixels"}},{"data":{"id":"projectopencodeproject","label":"Open Code Project","parentId":"themecyber","attributes":{"Link":"https://www.iqt.org/toward-secure-code-reuse/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612915130/themes/undraw_developer_activity_bv83.png","Status":"Complete","Description":"Building on recent software supply chain research and open source situational awareness, this project aims to help developers avoid 3rd degree burns on 3rd party software. It involves a survey and tooling focused on the PyPI codebase."}}},{"data":{"id":"93b666c2-d427-430e-9a34-24292c47da26","source":"themecyber","target":"projectopencodeproject"}},{"data":{"id":"projectskyscan","label":"SkyScan","parentId":"themeedgeai","attributes":{"Link":"https://github.com/IQTLabs/SkyScan","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1617999907/themes/undraw_aircraft_fbvl.png","Status":"Complete","Description":"Labeled data is freely available if you know where to look for it. SkyScan uses commodity HW to track and capture images of airborne aircraft along with their beacon metadata to auto-generate high-quality datasets"}}},{"data":{"id":"1878f836-e0ba-4923-ae16-68263fbd003a","source":"themeedgeai","target":"projectskyscan"}},{"data":{"id":"92fef4a6-8bd7-4349-9cf6-0dfde12f058f","source":"themebetterdata","target":"projectskyscan"}},{"data":{"id":"projectaiassurance","label":"AI Assurance","parentId":"themeuxdesign","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1620665633/themes/undraw_Maintenance_re_59vn.png","Status":"Complete","Description":"Improve the identification and quantification of risks inherent in AI/ML data, models, and tools. In FY21 we conducted an \"Assurance Audit\" of FakeFinder with a focus on 4 risk areas: Cyber, Bias, UX & Ethics."}}},{"data":{"id":"4dca97c5-3736-44f7-962c-435a93731bcd","source":"themeuxdesign","target":"projectaiassurance"}},{"data":{"id":"a2f3968d-0940-4dc8-8280-da22c6a687e6","source":"themebettermodels","target":"projectaiassurance"}},{"data":{"id":"themeuxdesign","label":"UX Design","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1618000133/themes/undraw_circles_y7s2.png","Description":"User research, design prototyping, and evaluation of techniques that help people make sense of data. This includes visualization, explanations, characterizations of uncertainty, and interfaces that encourage users to ask better questions."}}},{"data":{"id":"7f8195e2-629e-4019-b53c-1f457290844f","source":"themeuxdesign","target":"iqtlabscentralnode"}},{"data":{"id":"themebetterdata","label":"Better Data","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592322/themes/undraw_cohort_analysis_stny.png","Description":"The study of datasets. What is a given dataset good for? How much data does an AI/ML task really need? What are efficient ways of synthesizing training data? How can we automate data labeling? Does multimodal data allow us to build better models?"}}},{"data":{"id":"1594fdf2-1c89-4f95-8d9c-e266ccb9c2cb","source":"themebetterdata","target":"iqtlabscentralnode"}},{"data":{"id":"themebettermodels","label":"Better Models","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612759153/themes/undraw_solution_mindset_34bi.png","Description":"Improving model data pipelines, training processes, performance, and interpretability."}}},{"data":{"id":"92e0cbaf-286a-4bea-a5ab-40aaa9d00552","source":"themebettermodels","target":"iqtlabscentralnode"}},{"data":{"id":"themeedgeai","label":"Edge AI","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592211/themes/undraw_Follow_me_drone_kn76.png","Description":"Developing tools and techniques to harness the new wave of AI hardware to prototype novel, low-cost, and AI-enabled sensors and analytic platforms that can work without a tether to the cloud."}}},{"data":{"id":"51640fa8-c296-4f69-9153-6cddac68f9d2","source":"themeedgeai","target":"iqtlabscentralnode"}},{"data":{"id":"thememisinformation","label":"Misinformation","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612759153/themes/undraw_key_points_ig28.png","Description":"Detecting and mitigating mis-/dis-/mal-information in all modalities; this theme includes audiovisual deepfakes, memes, and text that is either intentionally or unintentionally created and spread."}}},{"data":{"id":"3b5c9797-763f-4b89-a83b-0a087f6ebb7b","source":"thememisinformation","target":"iqtlabscentralnode"}},{"data":{"id":"themecyber","label":"Cyber","parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592351/themes/undraw_hacker_mind_6y85.png","Description":"Understanding cyber threats and developing tools to mitigate them; this theme includes establishing and maintaining the integrity of critical systems such as supply chains, networks, servers, etc."}}},{"data":{"id":"5de6b9f2-78ed-4f3d-9e57-4ca480a1a2ef","source":"themecyber","target":"iqtlabscentralnode"}}]',
