ributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592401/themes/undraw_building_blocks_n0nc.png","Status":"Ongoing","Description":"Assess the risks and opportunities with multimodal machine learning models and associated data sources used in person (re)identification."}},"classes":"center-right"},{"data":{"id":"3b9b0dae-8456-4e55-ad8d-24d28f1a77dc","color":"#130047","width":2.5,"source":"themebettermodels","target":"projectfusingwithoutconfusing"},"classes":"multi-unbundled-bezier"},{"data":{"id":"d51e17bd-0f39-4b5d-b84a-76fe49beb316","color":"#f75040","width":2.5,"source":"thememisinformation","target":"projectfusingwithoutconfusing"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectsynthesizingrobustness","size":15,"color":"#027bfc","label":"Synthesizing Robustness","fontSize":14,"parentId":"themebetterdata","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592291/themes/undraw_privacy_protection_nlwy.png","Status":"Complete","Description":"Explore how synthetic data can improve the robustness of deep learning models and related techniques such as Generative Adversarial Networks (GANs) in the context of very-high resolution overhead imagery."}},"classes":"center-right"},{"data":{"id":"143b0ad7-aac2-488c-8fe7-c83055dacb64","color":"#027bfc","width":2.5,"source":"themebetterdata","target":"projectsynthesizingrobustness"},"classes":"multi-unbundled-bezier"},{"data":{"id":"9ad1ce9c-37c5-4ed0-92d6-95856f199314","color":"#130047","width":2.5,"source":"themebettermodels","target":"projectsynthesizingrobustness"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectaisonobuoy","size":15,"color":"#fbd300","label":"AI Sonobuoy","fontSize":14,"parentId":"themeedgeai","attributes":{"Link":"https://github.com/IQTLabs/AISonobuoy","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612759820/themes/undraw_Golden_gate_bridge_jkph.png","Status":"Ongoing","Description":"Much of the world is covered with water. Getting devices to work in this domain takes a lot of effort. Sonobuoy provides IQT Labs with hands-on experience collecting audio data and metadata for maritime situational awareness."}},"classes":"center-right"},{"data":{"id":"ac58b9ed-8363-46de-9ac6-c90d31c3913a","color":"#fbd300","width":2.5,"source":"themeedgeai","target":"projectaisonobuoy"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectdefensive-5g","size":15,"color":"#00acf1","label":"Defensive-5G","fontSize":14,"parentId":"themecyber","attributes":{"Link":"https://github.com/IQTLabs/AISonobuoy#pibuoy-1","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592351/themes/undraw_hacker_mind_6y85.png","Status":"Ongoing","Description":"Too often the default response to an attack is to retroactively block or deny access. This project examines the effetciveness of proven network defense tools and techniques in proactively securing multi-tenant 5G networks."}},"classes":"center-right"},{"data":{"id":"48e8699c-229f-4ae9-a1bf-e349f543674f","color":"#00acf1","width":2.5,"source":"themecyber","target":"projectdefensive-5g"},"classes":"multi-unbundled-bezier"},{"data":{"id":"596d4ec6-1f11-4d4e-8451-ecb49e719d8f","color":"#fbd300","width":2.5,"source":"themeedgeai","target":"projectdefensive-5g"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectfakefinder","size":15,"color":"#f75040","label":"FakeFinder","fontSize":14,"parentId":"thememisinformation","attributes":{"Link":"https://www.iqt.org/fakefinder-a-platform-for-deepfake-detection/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612760352/themes/undraw_Image__folder_re_hgp7.png","Status":"Complete","Description":"This project will develop a modular framework for accessing various deepfake detection models. When complete, it will offer a web application as well as API for integration into existing workflows for media forensics."}},"classes":"center-right"},{"data":{"id":"2766de18-c526-4363-9c65-5ddd46ca2c15","color":"#f75040","width":2.5,"source":"thememisinformation","target":"projectfakefinder"},"classes":"multi-unbundled-bezier"},{"data":{"id":"6a07a1f7-6e38-4c92-b3d3-152bed7238d4","color":"#130047","width":2.5,"source":"themebettermodels","target":"projectfakefinder"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectbirdseye","size":15,"color":"#fbd300","label":"BirdsEye","fontSize":14,"parentId":"themeedgeai","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592211/themes/undraw_Follow_me_drone_kn76.png","Status":"Complete","Description":"This project prototypes the capability to identify the location of a moving drone operator using an adaptive statistical technique to identify the radio frequency (RF) source signal. It  uses low-cost, distributed sensors and reinforcement learning"}},"classes":"center-right"},{"data":{"id":"82bead73-d10f-4f72-8040-fd376440a5a5","color":"#fbd300","width":2.5,"source":"themeedgeai","target":"projectbirdseye"},"classes":"multi-unbundled-bezier"},{"data":{"id":"bdddc004-633e-45df-a6b7-02403095fc10","color":"#00acf1","width":2.5,"source":"themecyber","target":"projectbirdseye"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectshiftingpixels","size":15,"color":"#fbd300","label":"Shifting Pixels","fontSize":14,"parentId":"themeedgeai","attributes":{"Link":"https://www.iqt.org/exploring-and-experimenting-with-event-cameras/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599589298/themes/undraw_explore_7ofa.png","Status":"Complete","Description":"Event cameras are an emerging sensing technology that allow us to perceive the world in new ways. The Shifting Pixels project explores the usability of event cameras and their applicability to customer challenges."}},"classes":"center-right"},{"data":{"id":"a1bc4a93-a2e6-475c-98c7-98f28abd784f","color":"#fbd300","width":2.5,"source":"themeedgeai","target":"projectshiftingpixels"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectopencodeproject","size":15,"color":"#00acf1","label":"Open Code Project","fontSize":14,"parentId":"themecyber","attributes":{"Link":"https://www.iqt.org/toward-secure-code-reuse/","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1612915130/themes/undraw_developer_activity_bv83.png","Status":"Complete","Description":"Building on recent software supply chain research and open source situational awareness, this project aims to help developers avoid 3rd degree burns on 3rd party software. It involves a survey and tooling focused on the PyPI codebase."}},"classes":"center-right"},{"data":{"id":"93b666c2-d427-430e-9a34-24292c47da26","color":"#00acf1","width":2.5,"source":"themecyber","target":"projectopencodeproject"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectskyscan","size":15,"color":"#fbd300","label":"SkyScan","fontSize":14,"parentId":"themeedgeai","attributes":{"Link":"https://github.com/IQTLabs/SkyScan","Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1617999907/themes/undraw_aircraft_fbvl.png","Status":"Complete","Description":"Labeled data is freely available if you know where to look for it. SkyScan uses commodity HW to track and capture images of airborne aircraft along with their beacon metadata to auto-generate high-quality datasets"}},"classes":"center-right"},{"data":{"id":"1878f836-e0ba-4923-ae16-68263fbd003a","color":"#fbd300","width":2.5,"source":"themeedgeai","target":"projectskyscan"},"classes":"multi-unbundled-bezier"},{"data":{"id":"92fef4a6-8bd7-4349-9cf6-0dfde12f058f","color":"#027bfc","width":2.5,"source":"themebetterdata","target":"projectskyscan"},"classes":"multi-unbundled-bezier"},{"data":{"id":"projectaiassurance","size":15,"color":"#7dc53e","label":"AI Assurance","fontSize":14,"parentId":"themeuxdesign","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1620665633/themes/undraw_Maintenance_re_59vn.png","Status":"Complete","Description":"Improve the identification and quantification of risks inherent in AI/ML data, models, and tools. In FY21 we conducted an \"Assurance Audit\" of FakeFinder with a focus on 4 risk areas: Cyber, Bias, UX & Ethics."}},"classes":"center-right"},{"data":{"id":"4dca97c5-3736-44f7-962c-435a93731bcd","color":"#7dc53e","width":2.5,"source":"themeuxdesign","target":"projectaiassurance"},"classes":"multi-unbundled-bezier"},{"data":{"id":"a2f3968d-0940-4dc8-8280-da22c6a687e6","color":"#130047","width":2.5,"source":"themebettermodels","target":"projectaiassurance"},"classes":"multi-unbundled-bezier"},{"data":{"id":"themeuxdesign","size":23,"color":"#7dc53e","label":"UX Design","fontSize":14,"parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/v1618000133/themes/undraw_circles_y7s2.png","Description":"User research, design prototyping, and evaluation of techniques that help people make sense of data. This includes visualization, explanations, characterizations of uncertainty, and interfaces that encourage users to ask better questions."}},"group":"nodes","classes":"center-right"},{"data":{"id":"7f8195e2-629e-4019-b53c-1f457290844f","color":"#7dc53e","width":4.5,"source":"themeuxdesign","target":"iqtlabscentralnode"},"classes":"multi-unbundled-bezier"},{"data":{"id":"themebetterdata","size":23,"color":"#027bfc","label":"Better Data","fontSize":14,"parentId":"iqtlabscentralnode","attributes":{"Image":"https://res.cloudinary.com/dzu5qhcon/image/upload/c_scale,w_226/v1599592322/themes/undraw_cohort_analysis_stny.png","Description":"The study of datasets. What is a given dataset good for? How much data does an AI/ML task really need? What are efficient ways of synthesizing training data? How can we automate data labeling? Does multimodal data allow us to build better models?"}},"group":"nodes","classes":"center-right"},{"data":{"id":"1594fdf2-1c89-4f95-8d9c-e266ccb9c2cb","color"